    .then(response => response.json())
    .then(json => {
      setData(json)
    })


  }, [])



const[data,setData]=useState({})


  return (
    <div>
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>ID</th>
          <th>Title</th>
          <th>completed</th>
        </tr>
      </thead>
      <tbody>
        <>
        {


        data.map((data)=>{
     return (
      <tr>
          <td>{data.userId}</td>
